@Regina Celia Soares Olá, Regina! Obrigado pela participação! Explicamos os detalhes dos eventos de trombose em outro vídeo (link abaixo).
De modo simplificado, os eventos foram mais frequentes em mulheres de até 50 anos. Porém, a incidência é muito baixa (1 caso a cada 250.000), principalmente no Brasil (1 caso a cada 4 Milhões). Além disso, os sintomas são tratáveis uma vez que identificados. Portanto, a vacinação ainda é recomendada no Brasil.
Abraço e muita saúde!

